        <li onClick={()=>{
          props.setShowComplated(false);
          props.setInprogress(true);
        } }>
          Inprogress
        </li>
      </ul>
      <div className="meetings">Meetings</div>
      <img className="side-bar-item" alt="" src="/rectangle-56.svg" />
      <img className="chevron-right-icon" alt="" src="/-chevronright.svg" />
      <div className="schedule-meeting">Schedule Meeting</div>
      <div className="chat">Chat</div>
      <img className="side-bar-inner" alt="" src="/ellipse-3@2x.png" />
      <div className="ellipse-div" />
      <div className="sara-doe">Sara Doe</div>
      <div className="saradoegmailcom">saradoe@gmail.com</div>
      {/* <img className="rectangle-icon" alt="" src="/rectangle-561.svg" />
